syntax = "proto2";
option go_package = "proto/guild_withdraw";
package guild_withdraw;
import "google/protobuf/timestamp.proto";

message GuildWithdrawMsg {
    optional string user_id = 1;
    optional string character_id = 2;
    optional string character_name = 3;
    optional string guild_id = 4;
    optional string guild_name = 5;
    optional string request_header_location = 6;
    optional google.protobuf.Timestamp log_time = 7;
    optional string uuid = 8;
}